🎙️ NOTÍCIAS DO PT 🇻🇳
📌 QUARTA, 11/01

✳️ Lula participa de cerimônia de posse de Anielle Franco e Sônia Guajajara;
✳️ Lula anuncia candidatura de Belém para sede da COP30;
✳️ Governo Federal identifica nova ameaça golpista e aciona STF;
✳️ Terroristas derrubam torre de energia de Itaipu.

▶️ Ouça agora:  https://bit.ly/3Xm2vOb

♟Relatório do Twitter DX - 11/10/23


As narrativas da  Extrema-direita:

1️⃣ Continua com discurso de vitimização e acusando as ações “autoritárias” do governo e do judiciário, utilizando referências a regimes totalitários para sustentar suas narrativas (“campos de Concentração).

2️⃣ Propagação de fake news sobre mortes de pessoas detidas;

3️⃣ Acusação de que a violência fora realizada por “infiltrados de esquerda”;

4️⃣ Acusações de omissão por parte do governo federal para centralizar o poder no país.
